		document.getElementById('xi').setAttribute("style", "visibility: visible");
		document.getElementById('nian').setAttribute("style", "visibility: hidden");
		document.getElementById('heng').setAttribute("style", "visibility: hidden");
		document.getElementById('text2').setAttribute("style", "visibility: visible");
		document.getElementById('text1').setAttribute("style", "visibility: hidden");
		document.getElementById('text3').setAttribute("style", "visibility: hidden");

		document.getElementById("anniu1").setAttribute("class", "fil8");
		document.getElementById("anniu2").setAttribute("class", "fil9");
		document.getElementById("anniu3").setAttribute("class", "fil8");
	}
	
	function changecolor3(){
		document.getElementById('tang').setAttribute("style", "visibility: visible");
		document.getElementById('gang').setAttribute("style", "visibility: hidden");
		document.getElementById('xi').setAttribute("style", "visibility: hidden");
		document.getElementById('nian').setAttribute("style", "visibility: visible");
		document.getElementById('heng').setAttribute("style", "visibility: visible");
		document.getElementById('text3').setAttribute("style", "visibility: visible");
		document.getElementById('text1').setAttribute("style", "visibility: hidden");
		document.getElementById('text2').setAttribute("style", "visibility: hidden");

		document.getElementById("anniu1").setAttribute("class", "fil8");
		document.getElementById("anniu2").setAttribute("class", "fil8");
		document.getElementById("anniu3").setAttribute("class", "fil9");
	}
